import React from "react";
import crown from "../../Assets/crown.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCrown, faClipboardCheck } from "@fortawesome/free-solid-svg-icons";
const Footer = () => {
  return (
    <div className="flex  w-1/4 mx-auto container">
      <div>
        <FontAwesomeIcon className="text-yellow-900 text-4xl" icon={faCrown} />
        <p className="text-white">crown</p>
      </div>

      <div className="mx-8">
        <FontAwesomeIcon
          className="text-white text-4xl"
          icon={faClipboardCheck}
        />
        <p className="text-white">crown</p>
      </div>
      <div>
        <FontAwesomeIcon className="text-yellow-900 text-4xl" icon={faCrown} />
        <p className="text-white">crown</p>
      </div>

      <div className="mx-8">
        <FontAwesomeIcon
          className="text-white text-4xl"
          icon={faClipboardCheck}
        />
        <p className="text-white">ab</p>
      </div>
    </div>
  );
};

export default Footer;
